    /**
     *
     * @param attributeList list of attribute names/values to initialize the row
     */
    protected void create(AttributeList attributeList) {

        super.create(attributeList);
        ContractImpl contract = getContract();


        String authType = (String)contract.getAttribute("AuthType");
        String contracType = (String)contract.getAttribute("ContractType");
        String customerName = (String)contract.getAttribute("AuthName");
        String authrizerType = (String)contract.getAttribute("AuthorizerType");

        if (authType != null && authType.length() > 0) {

            if (authType.equals(Codes.AUTH_TYPE_PLANT)) {
                setShipPlant(customerName);
                setPlantType(authrizerType);
            } else if (authType.equals(Codes.AUTH_TYPE_OWNER)) {
                setShipOwner(customerName);
                setOwnerType(authrizerType);
            } else if (authType.equals(Codes.AUTH_TYPE_BROKER)) {
                setShipBroker(customerName);
                setBrokerType(authrizerType);
            }
        }

        //如果合同类型为付款协议，则新建船号类型为付款船号
        if (contracType != null && contracType.length() > 0) {

            //setContractType(contracType);

            if (contracType.equals(Codes.CONTRACT_TYPE_AGREEMENT)) {
                this.setShipMnftNo(Codes.COL_VALUE_SHIP_NO);
                this.setImoNo("N/A");
                this.setShipName("N/A");

            }
        }

        setStatus(Codes.COL_VALUE_STATUS_DRAFT);

    }

